import React from 'react';
import './custom.css';

class Suggestions extends React.Component {
    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }



    handleClick() {
        alert('name');  
    }

    render() {
    if (this.props.results.length > 0) {
    const options = this.props.results.slice(0, 5).map((x, y) => (
        <span id="clickable-span" onClick={this.handleClick}><li key={y}>{x.title}</li></span>
    ))
    return <ul>{options}</ul>

    } else if (this.props.typed) { 
        return <div><p>No results</p></div> 
    } else return null;
        
}
}

export default Suggestions
